<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let missingValue = []
    let a = [7, 2, 5, 3, 5, 3]
    let b = [7, 2, 5, 6, 4, 3, 5, 3, 4]
    for (i = 0; i < b.length; i++) {
        for (j = 0; j < a.length; j++) {
            if (a.indexOf(b[i]) === -1 && missingValue.indexOf(b[i]) === -1) {
                missingValue.push(b[i]);
            }
        }
    }
    alert(missingValue.sort())
</script>
</body>
</html>
